graphql.query:
query ($v1: ID,$v2: String,$v3: ID,$v4: Float) {
    teaById(id: $v1) {
        name
    }
    teas (id : $v1, name : $v2, price: $v4){
        description

    }
    producers(id: $v3){
      name
    }
}

graphql.variables:
query ($v1: ID,$v2: String,$v3: ID,$v4: Float) {
    teaById(id: $v1) {
        name
    }
