        description

    }
    producers(id: $v3){
      name
    }
}

postProcessors.data:
pm.test("correct-T",function (){
    var jsonData = pm.response.json();
    pm.expect(jsonData.data.teaById.name).to.eql("data");
    pm.expect(jsonData.data.teas[0].description).to.eql("data");
    pm.expect(jsonData.data.producers[0].name).to.eql("Incredible Soft Chips")
}
)
